import React from 'react';
//import './Joul.css';
import WorkTitle from './WorkTitle/WorkTitle';
import { WorkOne } from './WorkTitle/Data';
import {Helmet} from 'react-helmet';

function Joul() {

    return (
        <>
        <Helmet>
            <title>Please work</title>
            <link rel="stylesheet" href="./Joul.css" />
        </Helmet>
        <p>Hello</p>
        <WorkTitle {...WorkOne} />
        </>
    );
}

export default Joul;
